import '../css/navbar.css'
import '../css/home.css'

export default function navbar(){
	return (
		<nav className="navbar">
			<div className='text-3'>Devices</div>
			<div className='text-3'>Image Upload</div>
			<div className='text-3'>Profile</div>
		</nav>
	)
}
